include_once PATH_TO_CCXT . '/test/exchange/base/test_shared_methods.php';

function test_omit() {
    $exchange = new \ccxt\Exchange(array(
        'id' => 'sampleexchange',
    ));
    assert_deep_equal($exchange, null, 'testOmit', $exchange->omit(array(), 'foo'), array());
    assert_deep_equal($exchange, null, 'testOmit', $exchange->omit(array(
        'foo' => 2,
    ), 'foo'), array());
    assert_deep_equal($exchange, null, 'testOmit', $exchange->omit(array(
        'foo' => 2,
        'bar' => 3,
    ), 'foo'), array(
        'bar' => 3,
    ));
    assert_deep_equal($exchange, null, 'testOmit', $exchange->omit(array(
        'foo' => 2,
        'bar' => 3,
    ), ['foo']), array(
        'bar' => 3,
    ));
}
